import {
    GET_POST,
    GET_USER_POST,
    ADD_POST,
    DELETE_POST,
    POST_ERROR,
 } from "../type";

 export default (state, action) => {
     switch(action.type){
         case GET_POST:
         return{
             state,
         }

         case GET_USER_POST:
         return{
             state,
         }

         case ADD_POST:
         return{
             state,
         }
         case DELETE_POST:
         return{
             state,
         }
         case POST_ERROR:
         return{
             state,
         }

         default:
         return state;
     }
 }
